import { makeStyles } from "@material-ui/core";

const useStyles = makeStyles(() => ({
  card: {
    backgroundColor: "#202020",
    color: "white",
    textAlign: "center",
    padding: "0.4rem",
    borderRadius: "1rem",
    maxWidth: "50%",
    margin: "3 auto",
  },
}));

const Card = (props) => {
  const classes = useStyles();

  return <div className={classes.card}>{props.children}</div>;
};

export default Card;
